import * as actions from '../actions';

export function* ServiceData(data) {
console.log("submit------services");
yield put(actions.ServiceData.request(data));
try {
    console.log("SUCCESS-SAGA_DASHBOARD")
    // const response = yield call(api.ServiceData);
    // yield put(actions.ServiceData.read.success(response));
  } catch ({ error }) {
    // yield put(actions.ServiceData.read.failure(error));
  }
}

export function* watchServiceData() {
while (true) {
const { payload } = yield take(actions.GUEST_LOG_IN);
console.log(payload, 'SERVICE SAGA PAYLOAD')
yield call(ServiceData, payload);
}
}

